description:
The Football League Show 07.12.2013 

Duration: 40 min

Manish Bhasin presents drama from the Football League. With clubs from Leagues One and Two in Cup action, the Championship takes centre stage. The feature match sees two sides battling for promotion go head-to-head, as Brighton entertain Leicester at the Amex. And Steve McClaren's Derby welcome Paul Ince's Blackpool to Pride Park.

